---- Department(학과) 

 create table department_info(
    department_id varchar2(20) not null,
    department_name varchar2(30) not null,
    constraint department_id_pk primary key(department_id)
);  



-- Student_info(학생정보)

create table student_info(
    student_id varchar2(20),
    department_id varchar2(20),
    student_name varchar2(50) not null,
    student_email varchar2(30) not null,
    student_pwd varchar2(30) not null,
    constraint student_id_pk primary key(student_id),
    constraint department_id_fk foreign key(department_id)
    references department_info(department_id)
);


--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
-- Subject_info(과목정보)

create table subject_info(
    major_or_not varchar2(10),
    subject_id varchar2(20) not null,
    subject_name varchar2(60),
    subject_score number(2),
    constraint subject_id_pk primary key(subject_id)
);  

 
 --------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
 -- Prof_info (교수정보)

 create table prof_info(
    prof_id varchar2(20) not null,
    department_id varchar2(20),
    prof_name varchar2(50),
    constraint prof_id_pk primary key(prof_id),
    constraint department_id_prof_fk foreign key(department_id)
    references department_info(department_id)
);


--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
-- Class_Room(강의실정보)

create table class_room(
    building_id varchar2(20),
    building_name varchar2(50),
    max_people number(5),
    constraint building_id_pk primary key(building_id)
);


--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
--Class_info(강의정보)
 create table class_info(
    class_id varchar2(20),
    subject_id varchar2(20),    
    department_id varchar2(20),
    class_currentcount number(4),
    prof_id varchar2(20),
    building_id varchar2(20),
    max_count number(3),
    constraint class_id_pk primary key(class_id),
    
    constraint class_subject_id_fk foreign key(subject_id)
    references subject_info(subject_id),
    constraint class_department_id_fk foreign key(department_id)
    references department_info(department_id),
    constraint class_prof_id_fk foreign key(prof_id)
    references prof_info(prof_id),
    constraint class_building_id_fk foreign key(building_id)
    references class_room(building_id)
);


--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
--Class_schedule_info(강의스케쥴)

 create table class_schedule_info(
    class_id varchar2(15),
    week_day char(3),
    start_time varchar2(10),
    end_time varchar2(10),
    constraint class_schedule_pk primary key(class_id,week_day, start_time),
    constraint class_schedule_fk foreign key(class_id) references class_info(class_id)
);


--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
-- Class_Request(수강목록)

drop table class_request;
create table class_request(
    id number,
    class_id varchar2(15),
    student_id varchar2(20),
    constraint class_request_pk primary key(id),
    constraint class_request_class_fk foreign key(class_id)  references class_info(class_id),
    constraint class_request_student_fk foreign key(student_id)  references student_info(student_id)	
);


--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
-- Class_History(성적)

create table class_history(
     id number,
     class_id number,
     score varchar2(5),
     percentage number(10,1),
constraint class_history_pk primary key(id),
     constraint history_class_id_fk foreign key(class_id)
     references class_request(class_id) on delete cascade
);



